import routesFront from "../../routes/routesFrontend.routes";
export interface ItemsNavbar {
  id: number;
  label: string;
  icon: string;
  route: string;
}
export const items: Array<ItemsNavbar> = [
  {
    id: 1,
    label: "Person",
    icon: "pi pi-fw pi-home",
    route: `${routesFront.module}${routesFront.person}`,
  },
  {
    id: 2,
    label: "Employee",
    icon: "pi pi-fw pi-calendar",
    route: `${routesFront.module}${routesFront.employe}`,
  },
];
